Technology Documentary hosted by Tony Hirst, published by National Geographic broadcasted as part of NG Megafactories series in 2012 - English narration


Information
------------------------------

Megafactories: The Mini Coupe
Take a look at the most amazing factories in the world.
Lift the lid on how millions of your everyday products and iconic designs begin life on the assembly line in a brand new series of Megafactories, The Mini Cooper is a unique insight into the construction of Mini's brand new derivative. The Mini Coupe is the Oxford plants first ever two seater sports vehicle. Follow the journey of the Mini Coupe as it makes it way through this state of the art factory based in the heart of England.

